var Bedrijvenzoeker = function (undefined) {

    'use strict';

    function getCompanyInformation(bedrijfsnaam, jwt) {
        if (jwt == null) {
            throw "Bedrijven zoeker is dependent on JWT key";
        }

        return $.ajax({
            url: '/CMSPages/WebService.asmx/GetCompanies',
            data: JSON.stringify({ query: bedrijfsnaam, tokenPassed: jwt }),
            type: 'POST',
            contentType: 'application/json',
            dataType: 'json'
        });
    }

    return {
        getCompanyInformation: getCompanyInformation,
    };
};
var Postcodezoeker = function (undefined) {

    'use strict';

    function getAddress(postcode, housenumber, jwt) {
        if (jwt == null) {
            throw "Postcode zoeker is dependent on JWT key";
        }

        return $.ajax({
            url: '/CMSPages/WebService.asmx/Address',
            data: JSON.stringify({ tokenPassed: jwt, postalCode: postcode, houseNumber: housenumber }),
            type: 'POST',
            contentType: 'application/json',
            dataType: 'json'
        });
    }

    return {
        getAddress: getAddress,
    };
};
/*
Simple log function that won't break in IE8 without Dev Tools opened
*/
// Create NCOI namespace if it doesn't exist
if (!("ncoi" in this)) {
	this.ncoi = {};
}
ncoi.log = function () {
	var console = window.console;
	if (typeof console === "object") {
		// If more than one argument, use apply()
		if(arguments.length > 0) {
			// Note: this doesn't work in IE8
			// since .log() is not a real function and therefore doesn't support apply() 
			if(typeof console.log === "function") console.log.apply(console, arguments);
		} else {
			// Works in IE8
			console.log(arguments[0]);
		}
	}
}
